【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ アグレッシブなデザインのハードテイルフレーム<br />650Bタイヤに合わせて新設計されたハードテイルフレーム。全面に大胆なグラフィックパターンを配置。<br /><br />★ 走破性が高い650B(27.5×2.1inch)タイヤ<br />定番の26インチタイヤに比べ大径の650B(27.5インチ)タイヤでは、段差越えの安定性に優れ、タイヤ一回転当たりの進む距離も向上します。<br /><br />★ ロックアウトが可能なフロントサスペンション<br />SUNTOUR製「XCM」シリーズを採用。サスペンションストロークをゼロにするロックアウトが可能で、シティライド～オフロードライドまで幅広く対応します。<br /><br />★ あらゆる道で力を発揮する24段変速ギア<br />フロント3速(42/32/22T)、リア8速(12-32T)の24段変速により平地・上り坂問わずに力を発揮できます。前後ディレーラーにはSHIMANO ALTUSを採用。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 全長：1780 mm<br />* 重量：14.8 kg<br />* ※ペダル、保安部品を取り外した状態です。<br />* サドル高：910 - 1010 mm<br />* ハンドル高：990 mm<br />* ハンドル幅：580 mm<br />* タイヤサイズ：27.5 × 2.1 inch<br />* フレームカラー：ブラック×オレンジ<br />* フレーム材質：アルミニウム<br />* フロントフォーク材質：アルミニウム<br />* 変速機：シマノ24段変速<br />* ペダル：固定式ペダル<br />* シフトレバー：シマノラピッドファイヤー右：8段 左：3段 <br />* フリーホイール：MIN：12T × MAX：32T  ※カセット式<br />* チェーンホイール：22 × 32 × 42T<br />* ブレーキ：前後：ディスクブレーキ<br />* 乗員重量・積載荷重：JIS D 9111 一般用自転車の諸元に基づく<br />* バルブ形式：英式バルブ(ウッズバルブ)</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
